An environment filled with sensitive magnetic particles from my collaboration with @BMW. At the center of the room stands the new electric model BMW i4, spreading the waves of transforming energy across the space. Using algorithms from the real world, I visualized patterns of magnetic fields in interaction of elements, based on both art and physics.

